import React from 'react';

const FavoritesPage = () => {
    const [favorites, setFavorites] = useState([]);
  
    useEffect(() => {
      const storedFavorites = JSON.parse(localStorage.getItem('favorites')) || [];
      setFavorites(storedFavorites);
    }, []);
  
    // Fetch user details from GitHub API or store user details in favorites
    // For simplicity, let's assume we're just working with user IDs for now
  
    return (
      <div>
        <h2>Favorited Users</h2>
        <div className='user-cards'>
          {favorites.map((userId) => (
            <div key={userId} className="user-card">
              {/* Display user details */}
            </div>
          ))}
        </div>
      </div>
    );
  };

  export default Favorite;
